void Integrate::enforceVelocityLimits(std::vector<double> &stateDeriv) const{
    for (size_t i = 0; i < stateDeriv.size() / 2; i++) {
        if (stateDeriv[i] > upperVelocityLimits_[i]) {
            stateDeriv[i] = upperVelocityLimits_[i];
        }
        else if (stateDeriv[i] < lowerVelocityLimits_[i]) {
            stateDeriv[i] = lowerVelocityLimits_[i];
        }
    }
}

void Integrate::setJointDamping(std::vector<double> &viscous) {	
	viscous_.clear();        
	for (auto &k: viscous) {
		viscous_.push_back(k);
	} 
}

double Integrate::factorial_(int num) const {
	double factor = 1;
	for (int i = 1; i < num + 1; i++) {
		factor = factor * i;
	}
	return factor;
}

MatrixXd Integrate::power_series_(MatrixXd &m, double t, int depth) const {	
	MatrixXd A_t = -t * m;
	MatrixXd A_i = -t * m;
	MatrixXd term = MatrixXd::Identity(m.rows(), m.cols());
	for (size_t i = 1; i < depth + 1; i++) {		
		term = term + A_i / factorial_(i + 1);
		A_i = A_i * A_t;
	}
	return t * term;
}

void Integrate::calc_inverse_inertia_matrix(MatrixXd &M) const {    
	M_inv_ = M.inverse();	
}

